package leetcode

import "testing"

func Test_findTheDifference(t *testing.T) {
	type args struct {
		s string
		t string
	}
	tests := []struct {
		name string
		args args
		want byte
	}{
		{
			name: "1",
			args: args{
				s: "abcd",
				t: "abcde",
			},
			want: 'e',
		},
		{
			name: "2",
			args: args{
				s: "abcd",
				t: "abecd",
			},
			want: 'e',
		},
		{
			name: "3",
			args: args{
				s: "",
				t: "y",
			},
			want: 'y',
		},
		{
			name: "4",
			args: args{
				s: "a",
				t: "aa",
			},
			want: 'a',
		},
		{
			name: "5",
			args: args{
				s: "ae",
				t: "aea",
			},
			want: 'a',
		},
		{

			name: "6",
			args: args{
				s: "",
				t: "",
			},
			want: 't',
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := findTheDifference(tt.args.s, tt.args.t); got != tt.want {
				t.Errorf("findTheDifference() = %v, want %v", got, tt.want)
			}
		})
	}
}
